import "../css/hats.css";

export function FirstHat() {

    const hatTopPart = {
        width: "50px",
        height: "50px",
        backgroundColor: "black",
        position: "absolute",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        borderRadius: "50% 50% 0 0",
    }

    const hatBottomPart = {
        width: "70px",
        height: "20px",
        backgroundColor: "black",
        position: "absolute",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
    }

 return (
     <div className="hats-hat-main-container">
            <div style={hatTopPart}></div>
            <div style={hatBottomPart}></div>
     </div>
 );
}
